	public static List<String> getMaxByteStringList(String str, int maxLen, int maxArrays)  {
		StringBuilder sb = new StringBuilder();
		ArrayList<String> strList = new ArrayList<String>();
		int curLen = 0;
		String curChar;
		for (int i = 0; i < str.length(); i++) {
			curChar = str.substring(i, i + 1);
			try {
				curLen += curChar.getBytes("utf-8").length;
			} catch (UnsupportedEncodingException e) {
				e.printStackTrace();
			}
			if (curLen > maxLen) {
				if (maxArrays == -1 || strList.size() <= maxArrays - 2) {
					strList.add(sb.toString());
					sb = new StringBuilder();
					curLen = 0;
					i--;
				} else
					break;
			} else
				sb.append(curChar);
		}
		strList.add(sb.toString());
		String[] strArr = new String[strList.size()];
		for (int i = 0; i < strList.size(); i++) {
			strArr[i] = strList.get(i);
		}
		return strList;
	}
